    // Convert to TypedArray for memory efficiency
    const coords = new Float32Array(rawData);
    const count = coords.length / 2;

    // --- 3. ANIMATION LOOP ---
    const totalTime = 4000; // 4 seconds
    const scalingFactor = totalTime / Math.sqrt(count - 1);
    const startTime = performance.now();
    let lastDrawnIndex = 0;

    ctx.fillStyle = "rgba(0, 0, 0, 0.7)";

    function animate(currentTime) {
      const elapsed = currentTime - startTime;

      // Calculate how many points should be visible
      let targetIndex = Math.floor(Math.pow(elapsed / scalingFactor, 2));
      if (targetIndex >= count) targetIndex = count;

      if (targetIndex > lastDrawnIndex) {
        ctx.beginPath(); // Start a new path for this batch

        for (let i = lastDrawnIndex; i < targetIndex; i++) {
          // Denormalize: Multiply percentage (0.5) by width (1200)
          const cx = coords[i * 2] * rect.width;
          const cy = coords[i * 2 + 1] * rect.height;

          // Move so we don't draw connecting lines
          ctx.moveTo(cx + 1.4, cy);
          // Draw Circle (Radius 1.15)
          ctx.arc(cx, cy, 1.4, 0, Math.PI * 2);
        }

        ctx.fill(); // Fill the whole batch at once
        lastDrawnIndex = targetIndex;
      }

      if (lastDrawnIndex < count) {
        requestAnimationFrame(animate);
      }
    }

    requestAnimationFrame(animate);
  }
